const LoginPage = () => {
    return (
        <form className="register">
            <h1>Login</h1>
            <input type="text"
                    placeholder="username"
            />
            <input type="password"
                    placeholder="password"
            />
            <button>Register</button>
        </form>
    );
}
 
export default LoginPage;
